import logo from './logo.svg';
import './App.css';
import React, { Component, useState } from 'react';

class App extends Component {

  constructor() {
    super();
    this.state = {
      cleanTechData: 0
    }
  }

  componentDidMount() {
    this.interval = setInterval(this.getCleanTechData, 1000);
  }

  componentWillUnmount() {
    clearInterval(this.interval);
  }

  getCleanTechData = async () => {
    var response = await fetch('http://localhost:5281/api/cleanTechData', { method: 'get' });

    var responsejson = await response.json();
    this.setState({ cleanTechData: responsejson.power })
  }

  render() {
    return (
      <div className='App'>
        <h1>{this.state.cleanTechData}</h1>
      </div>
    );
  }
}

export default App;
